    ('airedale terrier','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23050_airedale-terrier-300x189.jpg','Known as the “King of Terriers,” the Airedale is indeed the largest of all terriers. The dog breed originated in the Aire Valley of Yorkshire, and was created to catch otters and rats in the region between the Aire and Wharfe Rivers. An able sporting dog, he became an ideal working dog as well, proving his worth during World War I. Intelligent, outgoing, and confident, the Airedale possesses a wonderful playful streak that delights his owners.','1 foot, 9 inches to 1 foot, 11 inches tall at the shoulder','40 to 65 pounds','10 to 13 years','terrier dogs',NULL),
