    ('afghan hound','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23004_afghan-hound-300x189.jpg','The Afghan Hound is elegance personified. This unique, ancient dog breed has an appearance quite unlike any other: dramatic silky coat, exotic face, and thin, fashion-model build. Looks aside, Afghan enthusiasts describe this hound as both aloof and comical. Hailing from Afghanistan, where the original name for the breed was Tazi, the Afghan is thought to date back to the pre-Christian era and is considered one of oldest breeds.','2 feet to 2 feet, 4 inches tall at the shoulder','50 to 60 pounds','10 to 12 years','hound dogs',NULL),
