    ('alaskan malamute','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_22908_alaskan-malamute-300x189.jpg','The Alaskan Malamute features a powerful, sturdy body built for stamina and strength. It reigns as one of the oldest dog breeds whose original looks have not been significantly altered. This intelligent canine needs a job and consistent leadership to avoid becoming bored or challenging to handle.','1 foot, 11 inches to 2 feet, 1 inch tall at the shoulder','75 to 100 pounds','12 to 15 years','working dogs',NULL),
