    ('american bulldog','https://cdn1-www.dogtime.com/assets/uploads/2017/12/american-bulldog-breed-pictures-9-650x368.jpg','The American Bulldog is stocky and muscular, but also agile and built for chasing down stray cattle and helping out with work on the farm. In fact, some are known to jump six feet or more into the air.','20 to 28 inches','60 to 120 pounds','10 to 16 years','working dogs',NULL),
