    ('akita','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_22906_akita-300x189.jpg','The Akita is a large and powerful dog breed with a noble and intimidating presence. They were originally used for guarding royalty and nobility in feudal Japan. These dogs also tracked and hunted wild boar, black bear, and sometimes deer. The Akita does not back down from challenges and does not frighten easily. Consequently, they are fearless and loyal guardians of their families. Yet they are also affectionate, respectful, and amusing dogs when properly trained and socialized.','2 feet to 2 feet, 4 inches tall at the shoulder','70 to 130 pounds','10 to 12 years','working dogs',NULL),
