    ('american eskimo dog','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_23134_american-eskimo-dog-300x189.jpg','Called “the dog beautiful” by his admirers, the American Eskimo Dog, or “Eskie,” is a striking fellow with his white coat, sweet expression, and black eyes. He’s a Nordic dog breed, a member of the Spitz family. Eskies are lively, active companion dogs who love to entertain and join in on all family activities. They are outgoing and friendly with family and friends, but reserved with strangers. Although the Eskie is a small dog — 10 to 30 pounds — he has a big-dog attitude.','1 foot, 3 inches to 1 foot, 7 inches tall at the shoulder','starts at 30 pounds','12 to 15 years','companion dogs',NULL),
