    ('american foxhound','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23006_american-foxhound-300x189.jpg','Easygoing, sweet, kind, and loyal, the American Foxhound dog breed belongs to a way of life that has continued for more than two centuries, but he has the potential to be a modern-day companion as well. His stamina and love of running make him a great jogging partner for athletic owners, and his mild nature makes him an excellent family dog, so long as he gets the exercise he craves.','1 foot, 9 inches to 2 feet, 1 inch tall at the shoulder','40 to 60 pounds','12 to 13 years','hound dogs',NULL),
