    ('appenzeller sennenhunde','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23244_what-is-the-appenzeller-sennenhunde-dog-300x189.jpg','The Appenzeller originated as an all-around farm dog breed, who stayed busy herding the livestock, guarding the farm, and pulling carts in his native Switzerland. Today’s Appenzellers have still got the energy, smarts, and self-confidence that makes for valuable working dogs — but they’re anything but low-maintenance. Dogs of this breed need lots of exercise, training, and a job to do.','1 foot, 7 inches to 1 foot, 10 inches tall at the shoulder','48 to 55 pounds','9 to 12 years','herding dogs',NULL),
