    ('australian cattle dog','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23166_australian-cattle-dog-300x189.jpg','The Australian Cattle Dog is an extremely intelligent, active, and sturdy dog breed. Developed by Australian settlers to handle herds of cattle on expansive ranches, he’s still used today as a herding dog. He thrives on having a job to do and on being part of all family activities. He is loyal and protective of his family, though wary of outsiders. Besides herding work, the Australian Cattle dog does well at canine sports, including agility, obedience, rally, flyball, and flying disc competitions.','1 foot, 5 inches to 1 foot, 8 inches tall at the shoulder','30 to 50 pounds','12 to 15 years','herding dogs',NULL),
