    ('border collie','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23178_border-collie-300x189.jpg','The Border Collie dog breed was developed to gather and control sheep in the hilly border country between Scotland and England. He is known for his intense stare, or “eye,” with which he controls his flock. He’s a dog with unlimited energy, stamina, and working drive, all of which make him a premier herding dog; he’s still used today to herd sheep on farms and ranches around the world. The highly trainable and intelligent Border Collie also excels in various canine sports, including obedience, flyball, agility, tracking, and flying disc competitions.','1 foot, 6 inches to 1 foot, 10 inches tall at the shoulder','30 to 45 pounds','12 to 15 years','herding dogs',NULL),
