    ('chinese crested','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23104_17524831-300x189.jpg','The Chinese Crested dog breed was created to be an invalid’s companion. In that setting, you won’t find a better dog. They can almost read your mind and will lie in bed for hours without moving a muscle. They have almost no desire to go out and run around like regular dogs, although they are athletic enough to jump surprisingly tall fences and compete in agility. Chinese Cresteds are not gregarious, but they are intensely social and bond quickly within their pack. They don’t accept strangers easily. Once it falls in love with you, you’ll have a little stalker on your hands — he’ll be eternally, thoroughly devoted.','11 inches to 1 foot, 1 inch tall at the shoulder','up to 12 pounds','10 to 14 years','companion dogs',NULL),
