    ('lhasa apso','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23154_lhasa-apso-300x189.jpg','The Lhasa Apso dog breed is originally from Tibet, where he was a highly regarded watchdog in the palaces and monasteries of his mountainous homeland. Today’s Lhasa is no longer a palace guard but primarily a family companion who loyally protects his family from danger. Though small in stature, the Lhasa is a sturdy and independent dog.','9 inches to 11 inches tall at the shoulder','12 to 15 pounds','12 to 15 years','companion dogs',NULL),
