    ('lagotto romagnolo','https://cdn1-www.dogtime.com/assets/uploads/2018/07/lagotto-romagnolo-dog-breed-pictures-header-650x368.jpg','Lagotto Romagnolo means “lake dog from Romagna,” which is a good name for this breed, considering these dogs were originally bred to help hunt waterfowl through the wet marshlands of Romagna in Italy. They are also known as Italian Water Dogs and Romagna Water Dogs. Today, with many of the marshlands of the breed’s homeland drained, these dogs have found a new purpose in truffle hunting. Owners can easily train them to use their super noses for scent work, and Lagottos’ thick coats help them stay warm in fall and winter while protecting them from thorns and debris as they run through forests.','14 to 19 inches','24 to 35 pounds','14 to 17 years','sporting dogs',NULL),
