    ('lowchen','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23156_lowchen-300x189.jpg','The Lowchen is a toy dog breed that was developed as a companion dog and still finds itself in this role today. Active and smart, they do very well in dog competitions such as obedience and agility, and surpass the expectations that many have for a family companion.','1 foot to 1 foot, 2 inches tall at the shoulder','9 to 18 pounds','13 to 15 years','companion dogs',NULL),
