    ('maltese','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23114_maltese-300x189.jpg','A dog breed who’s gentle and fearless, the Maltese greets everyone as a friend. His glamorous white coat gives him a look of haughty nobility, but looks can be deceiving. This is a sprightly, vigorous dog who excels not only as a companion but also as a therapy dog and competitor in such dog sports as agility, obedience, rally, and tracking. But most of all, he loves to be with his people.','8 inches to 10 inches tall at the shoulder','up to 7 pounds','12 to 15 years','companion dogs',NULL),
