    ('manchester terrier','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23224_manchester-terrier-300x189.jpg','This lively, spirited dog breed is a true terrier. Bred in Manchester, England, for the common man’s sports of rat killing and rabbit coursing, he’s got game and he loves to show it. The Gentleman’s Terrier (as he is known in Victorian England) is not a sparring dog but loves a good chase, making him a flyball and agility rock star.','1 foot, 3 inches to 1 foot, 4 inches tall at the shoulder','12 to 22 pounds','14 to 16 years','terrier dogs',NULL),
