    ('maltese shih tzu','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23216_maltese-shih-tzu-300x189.jpg','The Maltese Shih Tzu, also known as the Mal-Shi, Malti zu, and the Malt-Tzu, is a dog breed hybrid. One of the few “designer dogs” not originating with a Poodle, and therefore not one of the ubiquitous “Poo” or “Doodle” hybrids, the adaptable Maltese Shih Tzu is an adorable, sweet little guy with a long name. Created with the same goal as the Doodles — to be a small companion who doesn’t shed much and is therefore more appropriate for people with allergies — the Maltese Shih Tzu is a classic cross, a sweet lapdog who likes to play with the kids.','from 10 inches tall at the shoulder','6 to 12 pounds','12 to 14 years','hybrid dogs',NULL),
