    ('mastiff','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_22934_mastiff-300x189.jpg','The Mastiff is one of the most ancient types of dog breeds. Their ancestor, the Molossus, was known 5,000 years ago. Back then, they were ferocious war dogs, very different from the benevolent behemoth that the breed is today.','27 to 32 inches tall at the shoulder','130 to 220 pounds','6 to 10 years','working dogs',NULL),
