    ('miniature schnauzer','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23074_miniature-schnauzer-300x189.jpg','He a dog breed who’s got it all in one small package: intelligence, affection, an extroverted temperament, humor, and a personality that’s twice as big as he is. Throw in that walrus moustache and quivering enthusiasm, and he’ll make you laugh every day. With a Miniature Schnauzer in the house, you’ll never be alone, not even when you go to the bathroom. He’s got personality-plus, and whether he’s bounding around ahead of you or curled up snoozing on your lap, you’ll never be bored with him around.','1 foot to 1 foot, 2 inches tall at the shoulder','11 to 20 pounds','12 to 14 years','terrier dogs',NULL),
