    ('miniature pinscher','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_23116_miniature-pinscher-300x189.jpg','The Miniature Pinscher dog breed was originally bred in Germany to hunt vermin, primarily rats, in homes and stables. Many people think that the Miniature Pinscher was developed by breeding Dobermans to progressively smaller sizes, and indeed, the Miniature Pinscher looks similar to a Doberman. However, the Min Pin is a distinct and much older breed. Known as the “King of Toys” for his stately appearance and self-assured attitude, the Miniature Pinscher is a fearless, energetic, and alert companion dog who enjoys the company of his family.','10 inches to 1 foot tall at the shoulder','8 to 11 pounds','10 to 14 years','companion dogs',NULL),
