    ('mutt','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23228_mutt-300x189.jpg','A mixed-breed dog is a testament to nature. Without any input — some might say interference — from humans, the mixed breed defies description. Available in all sizes, shapes, colors, and patterns, he might have a long snout or a short nose. He may display prick ears or floppy ones. He could have a stubby tail, spindly legs, a giant spot over his left eye — or all three. A divine inspiration, the mixed breed is gloriously, wonderfully someone else’s design.',NULL,NULL,'8 to 15 years','mixed breed dogs',NULL),
