    ('rat terrier','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23226_rat-terrier-dog-breed-300x189.jpg','Members of the Rat Terrier dog breed are adorable little digging escape artists who are true terriers: feisty, funny, energetic, lively, vermin-chasing, and incapable of being boring. Stubborn as all get out, they are not big on pleasing people, but the people who love them laugh all the time. The Rat Terrier is the ideal farm dog that he was always intended to be. President Theodore Roosevelt is said to have given the breed its name after his own terrier had eradicated the rat infestation at the White House; clearly, the Rat Terrier excels as a public servant — as long as it’s in his own best interest. He’s an American tradition just like apple pie, but watch your plate or you may find you’re missing dessert.','1 foot, 1 inch to 1 foot, 4 inches tall at the shoulder',NULL,'13 to 18 years','terrier dogs',NULL),
