    ('schnoodle','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23206_schnoodle-300x189.jpg','What a pistol! Smart, active, and adorable, the Schnoodle has become a popular hybrid dog breed. He’s a cross between the Poodle and the Schnauzer and can be found in many colors. Ranging from 6 to 76 pounds, the Schnoodle has a place as a lap dog, a family dog, a therapy dog, or a performance dog. The vast majority of them are small dogs. The appeal of this hybrid is that they generally have the Poodle’s willingness to please mixed with the sturdiness and activity of the Schnauzer. Playful and lovable, this dog lives to have fun and is always the center of attention.','1 foot, 3 inches to 2 feet, 2 inches tall at the shoulder','20 to 75 pounds','10 to 15 years','hybrid dogs',NULL),
