    ('scottish terrier','https://cdn2-www.dogtime.com/assets/uploads/2011/01/file_23082_scottish-terrier-300x189.jpg','An independent and stubborn character, the Scottish Terrier dog breed is also quite sensitive to praise and blame. Independent, intelligent, and hilarious in his dignified seriousness, he’s a true terrier, which makes him an excellent watchdog. Thanks to those incredibly short legs, he’s not going to train for a marathon with you — heck, he won’t even go jogging with you — but he is a perfect walking companion, especially if you appreciate his vocal approach to bicycles and squirrels. Despite his size, he doesn’t yap: he has a powerful bark that can scare the wits out of the unsuspecting burglar or delivery person. He totally rocks at agility and earthdog trials (those vermin have got to go). You’ll enjoy a rodent-free yard with him around, but watch out for the holes he’s dug.','up to 10 inches tall at the shoulder','18 to 22 pounds','11 to 13 years','terrier dogs',NULL),
