    ('yorkipoo','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_23208_yorkipoo-300x189.jpg','A fun-loving “designer dog” — and therefore a mixed dog breed — a Yorkipoo is a cross between the Yorkshire Terrier and a Toy or Miniature Poodle. Intelligent, affectionate, and gentle, he makes a delightful companion and is perfectly suited to apartment life, especially if you don’t mind the barking. He has plenty of energy to be burned off and he loves to play when he’s not parked on your lap watching the world go by. His ability to run fast and jump high can be surprising to those who aren’t expecting a canine Superman in miniature.','7 inches to 1 foot, 3 inches tall at the shoulder','3 to 14 pounds','10 to 15 years','hybrid dogs',NULL),
