    ('whippet','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23048_whippet-300x189.jpg','The Whippet dog breed was a poacher’s best friend, speedily going after rabbits and other small game. Today the Whippet competes in agility, flyball, lure coursing, rally, and obedience and is a loving therapy dog. His unique nature, friendly personality, and stylish look make him a favorite as a family companion as well as in the show ring.','1 foot, 6 inches to 1 foot, 10 inches tall at the shoulder','18 to 48 pounds','12 to 15 years','hound dogs',NULL),
    ('whippet','https://cdn1-www.dogtime.com/assets/uploads/2011/01/file_23048_whippet-300x189.jpg','The Whippet dog breed was a poacher’s best friend, speedily going after rabbits and other small game. Today the Whippet competes in agility, flyball, lure coursing, rally, and obedience and is a loving therapy dog. His unique nature, friendly personality, and stylish look make him a favorite as a family companion as well as in the show ring.',NULL,NULL,NULL,NULL,'5eaff43af96b5978ca726e2b'),
    ('west highland white terrier','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_23092_west-highland-white-terrier-300x189.jpg','The best way to describe this wee white Terrier dog breed from Scotland is simply to say that he’s so full of self-esteem that he knows he’s the best thing around. Always on the lookout for a good time, he’ll make you laugh while he entertains himself. He’s friendly and happy, with a lively nature that endears him to everyone (except small rodents), especially when he cocks his head to the side and looks at you quizzically.','10 inches to 11 inches tall at the shoulder','13 to 22 pounds','12 to 16 years','terrier dogs',NULL),
