    ('whoodle','https://cdn2-www.dogtime.com/assets/uploads/2019/07/whoodle-mixed-dog-breed-pictures-cover-650x368.jpg','The Whoodle is a mixed breed dog–a cross between the Soft-Coated Wheaten Terrier and Poodle dog breeds. Playful, friendly, and active, these pups inherited some of the best qualities from both of their parents.','12 to 20 inches','20 to 45 pounds','12 to 15 years','mixed breed dogs',NULL),
