    ('welsh terrier','https://cdn3-www.dogtime.com/assets/uploads/2011/01/file_23090_welsh-terrier-300x189.jpg','The Welsh Terrier dog breed‘s zest for life is contagious, and he always enjoys himself to the fullest. Bred to hunt independently, with all the self-determination and intelligence that entails, the happy and lively Welshie rarely gets tired and wants to spend his days having fun, fun, fun. His joy, his attitude, and his brains all add up to one wonderful package: He’s a true Terrier.','1 foot, 2 inches to 1 foot, 3 inches tall at the shoulder','up to 20 pounds','10 to 14 years','terrier dogs',NULL),
