DROP DATABASE IF EXISTS allthingspets_db;
CREATE DATABASE allthingspets_db;

CREATE TABLE IF NOT EXISTS dog_breeds (
    `list_breedName` VARCHAR(34) CHARACTER SET utf8,
    `list_image` VARCHAR(127) CHARACTER SET utf8,
    `list_description` VARCHAR(788) CHARACTER SET utf8,
    `list_dogInfo_height` VARCHAR(78) CHARACTER SET utf8,
    `list_dogInfo_weight` VARCHAR(30) CHARACTER SET utf8,
    `list_dogInfo_life` VARCHAR(68) CHARACTER SET utf8,
    `list_dogInfo_breedGroup` VARCHAR(16) CHARACTER SET utf8,
    `list_id` VARCHAR(24) CHARACTER SET utf8
);
